import Aside from "../components/Aside";
import "./css/safekids.css";
import { ReactComponent as SafekidsSVG } from "../assets/safekids.svg";
import { ReactComponent as ManagerSVG } from "../assets/safekids.svg";

const Safekids = () => {
  return (
    <main className="safekids">
      <Aside />
      <ul>
        <li>
          <SafekidsSVG />
        </li>
        <li></li>
      </ul>
    </main>
  );
};

export default Safekids;
